#suppliers_list {
    font-family: Arial, Helvetica, sans-serif;
    border-collapse: collapse;
    width: 100%;
  }
  
  #suppliers_list td, #customers th {
    border: 1px solid #ddd;
    padding: 8px;
  }
  
  #suppliers_list tr:nth-child(even){background-color: #f2f2f2;}
  
  #suppliers_list tr:hover {background-color: #ddd;}
  
  #suppliers_list th {
    padding-top: 12px;
    padding-bottom: 12px;
    text-align: left;
    background-color: black;
    color: white;
  }
  h1{
    text-align: center;
